          <FormCheck label="Apenas tempo Integral" id="periodo"/>

        </Navbar.Brand>

        <Navbar.Brand>
        
          <Button>Buscar</Button>
        
        </Navbar.Brand>
    </Container>

  </Navbar>
        </>
    )
}




export default Search
